import React from "react";

export default function Visualizer({ logs }) {
  return (
    <div className="visualizer">
      <h3>Console Output:</h3>
      <div className="console-output">
        {logs.map((log, index) => (
          <div key={index}>{log}</div>
        ))}
      </div>
    </div>
  );
}
